script: |
  super -f text -I q3915.spq | sort > q3915.out

inputs:
  - name: q3915.spq
    data: |
      SELECT - 96, col1 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE col1 NOT IN ( - col1, - 38 * + col2, + 31 * col0 + - col1 );
  - name: tab0

outputs:
  - name: q3915.out
    data: |
      -96	1
      -96	21
      -96	81
